import React, {Component} from 'react';
import GetWebsiteData from './getWebsiteData';

class AddPost extends Component {
    state = {
        websiteURL: 'http://engineering.dishantagnihotri.com/mapbox/change-base-map-without-loosing-styles-layers-on-mapbox/'
    };

    render () {
        return (
            <React.Fragment>
                <div className="ui one column stackable center aligned page grid">
                    <div className="ui labeled input">
                        <div className="ui label">
                            URL
                        </div>
                        <input type="text" placeholder="Enter website URL" />
                    </div>
                </div>
                <GetWebsiteData url={websiteURL} />
                <br /><br />
            </React.Fragment>
        )
    }
}
export default AddPost;
